    <Grid2 style={{justifyItems: "center", height: "100%"}}>
      <Grid2 style={{backgroundColor: "green",  padding: 0, alignContent: "center", justifyItems: "center"}}>
          <DisplayHeader />
          <DisplayScreen />
      </Grid2>
    </Grid2>
  );
}

export default App;
